function LoginInput () {
  return (
    <ul>
        <li>
          <label for='login'>Login: </label>
          <input type='text' name='login' />
        </li>

        <li>
          <label for='login'>Password: </label>
          <input type='password' name='password' />
        </li>
      </ul>
  )
}

export default LoginInput;
